unsignedTemp = INT8_FROM_LE(*(UInt8*)(data->pData + (42)));           
  unsignedTemp = unsignedTemp >> 2;                    
  unsignedTemp = unsignedTemp & 0x1;                             
  CANMMCAN_RX_Msg_1_Sgn_27 = (UInt8)1 * (UInt8)unsignedTemp + (UInt8)(0);                    

