  unsignedTemp = unsignedTemp >> 3;                    
  unsignedTemp = unsignedTemp & 0x3;                             
  CANMMCAN_RX_Msg_1_Sgn_28 = (UInt8)1 * (UInt8)unsignedTemp + (UInt8)(0);                    

/* COM_Region_Code_V */ 
unsignedTemp = INT8_FROM_LE(*(UInt8*)(data->pData + (42)));           
  unsignedTemp = unsignedTemp >> 5;                    
  unsignedTemp = unsignedTemp & 0x1;                             
  CANMMCAN_RX_Msg_1_Sgn_29 = (UInt8)1 * (UInt8)unsignedTemp + (UInt8)(0);                    

/* COM_Region_Code */ 
unsignedTemp = INT16_FROM_LE(*(UInt16*)(data->pData + (42)));           
  unsignedTemp = unsignedTemp >> 6;                    
  unsignedTemp = unsignedTemp & 0xF;                             
  CANMMCAN_RX_Msg_1_Sgn_30 = (UInt8)1 * (UInt8)unsignedTemp + (UInt8)(0);                    

/* COM_Driving_Side_V */ 
unsignedTemp = INT8_FROM_LE(*(UInt8*)(data->pData + (43)));           
